
SELECT MAX("managers"."rank") as agg_0 FROM "salaries" LEFT OUTER JOIN "teams" ON "salaries"."teamID" = "teams"."teamID" LEFT OUTER JOIN "els_teamnames" ON "teams"."teamID" = "els_teamnames"."teamid" LEFT OUTER JOIN "managers" ON "teams"."teamID" = "managers"."teamID" LEFT OUTER JOIN "managershalf" ON "managers"."managerID" = "managershalf"."managerID"  WHERE "managershalf"."teamID" != '%OAK%' AND "els_teamnames"."franchid" = '%ROC%' AND "managers"."L" >= 73 AND "managershalf"."lgID" LIKE '%AL%' AND "managers"."teamID" != '%BRO%' AND "els_teamnames"."lgid" IN ('FL', 'NL', 'UA', 'AL', 'PL') AND "teams"."divID" = '%E%' AND "salaries"."playerID" IN ('francjo01');